import React, { Component } from "react";
import {
  Button,
  View,
  Text,
  TouchableOpacity,
  ListView,
  StyleSheet,
  FlatList,
  Section,
  Modal,
  TouchableHighlight,
  TextInput,
  ScrollView,
} from "react-native";
import {
  Table,
  TableWrapper,
  Row,
  Rows,
  Col,
  Cols,
  Cell,
} from "react-native-table-component";
import courseList from "./data/courses.json";

class Fitnessinfo extends Component {
  constructor(props) {
    super(props);
    this.state = {
      myArray: [],
      tableHead: ["Name", "Preis", "Beschreibung"],
      widthArr: [100, 100, 80, 100, 120, 140, 160, 180, 200],
      courseList: courseList,
    };
  }

  componentDidMount() {
    this.setState({ myArray: courseList });
  }
  _deleteCourse(id) {
    const { courseList } = this.state;
    this.setState({
      courseList: courseList.filter((fitness) => fitness.id !== id),
    });
    console.log("Deleted");
    return;
  }

  render() {
    const element = (data, index) => (
      <TouchableHighlight onPress={() => this._deleteCourse}>
        <View>
          <Text>button</Text>
        </View>
      </TouchableHighlight>
    );
    const tableData = this.state.myArray.map((record) => [
      record.name,
      record.price,
      record.description,
    ]);
    const courseList = this.state.courseList.map((fitness) => [
      fitness.name,
      fitness.price,
      fitness.description,
    ]);
    return (
      <View style={styles1.container}>
        <ScrollView horizontal={true}>
          <View>
            <Table borderStyle={{ borderWidth: 1, borderColor: "#C1C0B9" }}>
              <Row
                data={this.state.tableHead}
                widthArr={this.state.widthArr}
                style={styles1.header}
                textStyle={styles1.text}
              />
              {courseList.map((rowData, index) => (
                <Row key={index}>
                  {rowData.map((cellData, cellIndex) => (
                    <Cell
                      key={cellIndex}
                      data={
                        cellIndex === 3 ? element(cellData, index) : cellData
                      }
                    />
                  ))}
                </Row>
              ))}
            </Table>
          </View>
        </ScrollView>
      </View>
    );
  }
}

const styles1 = StyleSheet.create({
  container: { flex: 1, padding: 16, paddingTop: 30, backgroundColor: "#fff" },
  header: { height: 50, backgroundColor: "#537791" },
  text: { textAlign: "center", fontWeight: "100" },
  dataWrapper: { marginTop: -1 },
  row: { height: 40, backgroundColor: "#E7E6E1" },
});

export default Fitnessinfo;

